import { Link } from "react-router-dom";
import './storyCard.css'
import React from "react";
import { stories } from "./stories";

export const StoryCard = () => {

  return (
    <div className="card">
        {stories.length > 0 && (
        stories.map((data, key) => {
          return (
              <div key={key}>
                { 
                  stories._story +
                  stories._imageURL +
                  stories.description
                }
              </div>
          );
        }))}

    </div>
  );
};

export default StoryCard;
